To achieve this, you can follow these steps:

1. **Load the datasets**: Load the `onsite_attributed_data` and `top_frequent_queries` datasets.
2. **Broadcast the top frequent queries**: Broadcast the `top_frequent_queries` dataset to all nodes to avoid shuffling.
3. **Process the `onsite_attributed_data`**: For each record in `onsite_attributed_data`, check if the query is in the `top_frequent_queries` and maintain a cache.
4. **Calculate the hit rate**: Count the number of cache hits and misses, and then calculate the hit rate.

Here's a sample Spark job in Java:

```java
import org.apache.spark.api.java.JavaRDD;
import org.apache.spark.api.java.JavaSparkContext;
import org.apache.spark.broadcast.Broadcast;
import org.apache.spark.sql.SparkSession;

import java.io.Serializable;
import java.util.HashMap;
import java.util.HashSet;
import java.util.Map;
import java.util.Set;

public class CacheHitRateCalculator {

    public static void main(String[] args) {
        SparkSession spark = SparkSession.builder()
                .appName("Cache Hit Rate Calculator")
                .master("local[*]")
                .getOrCreate();

        JavaSparkContext jsc = new JavaSparkContext(spark.sparkContext());

        // Load the datasets
        JavaRDD<String> onsiteAttributedData = jsc.textFile("path/to/onsite_attributed_data.txt");
        JavaRDD<String> topFrequentQueries = jsc.textFile("path/to/top_frequent_queries.txt");

        // Broadcast the top frequent queries
        Set<String> topQueriesSet = new HashSet<>(topFrequentQueries.collect());
        Broadcast<Set<String>> broadcastTopQueries = jsc.broadcast(topQueriesSet);

        // Process the onsite attributed data
        Map<String, Long> cache = new HashMap<>();
        long totalQueries = 0;
        long cacheHits = 0;

        for (String record : onsiteAttributedData.collect()) {
            String[] fields = record.split(",");
            String query = fields[0];
            String timestamp = fields[1];

            totalQueries++;

            if (broadcastTopQueries.value().contains(query)) {
                if (cache.containsKey(query)) {
                    // Cache hit
                    cacheHits++;
                } else {
                    // Cache miss
                    cache.put(query, Long.parseLong(timestamp));
                }
            }
        }

        // Calculate the hit rate
        double hitRate = (double) cacheHits / totalQueries;
        System.out.println("Cache Hit Rate: " + hitRate);

        spark.stop();
    }
}
```

### Explanation:

1. **Loading Datasets**:
   - `onsiteAttributedData` and `topFrequentQueries` are loaded as JavaRDDs.
   - The `topFrequentQueries` are collected into a `Set` and broadcasted to all nodes.

2. **Processing the Data**:
   - For each record in `onsiteAttributedData`, the query is checked against the broadcasted `topFrequentQueries`.
   - If the query is in the `topFrequentQueries`, it is checked against the cache.
   - If the query is already in the cache, it is a cache hit; otherwise, it is a cache miss, and the query is added to the cache.

3. **Calculating the Hit Rate**:
   - The total number of queries and the number of cache hits are counted.
   - The hit rate is calculated as the ratio of cache hits to the total number of queries.

